// Import the React and ReactDOM libraries 
import React from 'react';
import ReactDOM from 'react-dom';
import './style.scss';

// Create a react component 
const App = () => {
  return (
    <>
      <h1>Title</h1>
      <main>
        <ul>
          <li><a href="./aboutUs.html">Listings</a></li>
          <li><a href="./aboutUs.js">Investments</a></li>
          <li><a href="./aboutUs.js">Customer Experience</a></li>
          <li><a href="./aboutUs.js">About Us</a></li>
        </ul>
        <img src="../assets/house.jpg" alt="house"></img>
      </main>
      <footer>
        <div id="clients">
        <h2> For Clients</h2>
        <ul> 
          <li>Social Media</li>
        </ul>
        </div>
      </footer>
    </>
  )
};

// Take the react component and show it on the screen 
ReactDOM.render(
  <App />,
  document.querySelector('#root')
);
